// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awListCheckboxItemRenderFunction } from 'js/AwListCheckboxItemService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwListCheckboxItemService', () => import('js/AwListCheckboxItemService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awListCheckboxItemRenderFunction",
            "deps": "js/AwListCheckboxItemService"
        }
    },
    "data": {
        "_state": null
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "action": {
            "type": "action"
        },
        "vmo": {
            "type": "viewModelObject"
        }
    },
    "_viewModelId": "AwListCheckboxItem",
    "_uniqueViewModelId": "AwListCheckboxItem",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awListCheckboxItemRenderFunction, undefined, ctxImportObj );

export default Component;
